(1, '1', 1, 'စစ်အာဏာရှင် ဆန့်ကျင်ရေး ဦးဆောင် လှုပ်ရှားသူ ဒဂုံ တက္ကသိုလ်ကျောင်းသား ၇ ဦးကို စစ်ကောင်စီတရားရုံးက သေဒဏ် ချမှတ်', 'Olena Zelenska: Dialogue across generations', '<div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Mr Masterson, who is best known for his role in the sitcom That 70s Show, was accused of raping three women at his home in Hollywood in the early 2000s.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">He had denied the charges, saying he was being persecuted for his membership of the Church of Scientology.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">The office of the Los Angeles County District Attorney said it was considering its next steps in the case.</span></p></div></div><div class=\"teads-adCall\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; color: rgb(20, 20, 20);\"></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Lawyers for Mr Masterson did not immediately respond to a request for comment from the Associated Press.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">A retrial has been scheduled for March.</span></p></div></div><div id=\"piano-inline1\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; color: rgb(20, 20, 20);\"></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Mr Masterson, 46, was charged in 2020 with raping three women, who were all in their 20s, between 2001 and 2003.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">The accusations were made in 2017, during the MeToo movement which saw many Hollywood stars accused of sexual assault.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">As a result, Mr Masterson was written out of the Netflix show The Ranch. He responded by saying that he had not been charged or convicted of a crime, and that in the climate at the time \"it seems as if you are presumed guilty the moment you are accused\".</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">If convicted, he could face 45 years to life in prison.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Deliberations in the case began in mid-November, but soon reached a deadlock which could not be resolved.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">In a statement, the attorney\'s office said: \"While we are disappointed with the outcome in this trial, we thank the jurors for their service.\" It added: \"We also want to give our heartfelt appreciation to the victims for bravely stepping forward and recounting their harrowing experiences.\"</span></p></div></div><div id=\"piano-inline2\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; color: rgb(20, 20, 20);\"></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Two of the women involved in the case alleged that the Church of Scientology, to which they and Mr Masterson belonged, had discouraged them from reporting the alleged rapes.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">The Church has strongly denied pressurising victims.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">The charges came after a three-year investigation by the Los Angeles Police Department. Prosecutors did not file charges in two other cases because of insufficient evidence and the statute of limitations expiring.</span></p></div></div><div data-component=\"text-block\" class=\"ssrcss-11r1m41-RichTextComponentWrapper ep2nwvo0\" style=\"margin: 1rem 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6; font-family: ReithSans, Helvetica, Arial, freesans, sans-serif; vertical-align: baseline; max-width: 36.25rem; color: rgb(20, 20, 20);\"><div class=\"ssrcss-7uxr49-RichTextContainer e5tfeyi1\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline; overflow-wrap: break-word;\"><p class=\"ssrcss-1q0x1qg-Paragraph eq5iqo00\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6; font-family: inherit; vertical-align: baseline;\"><span style=\"font-family: \"Times New Roman\"; font-size: 14px;\">Mr Masterson played the role of Steven Hyde in That 70s Show between 1998 and 2006, alongside Ashton Kutcher and Mila Kunis.</span></p></div></div>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" segoe=\"\" ui=\"\" historic\",=\"\" \"segoe=\"\" ui\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(5,=\"\" 5,=\"\" 5);=\"\" font-size:=\"\" 15px;\"=\"\" style=\"font-family: Padauk, Arial, Verdana, Geneva, Helvetica, sans-serif; white-space: pre-wrap; margin: 0.5em 0px 0px; overflow-wrap: break-word;\"><div dir=\"auto\" style=\"font-family: inherit;\"><span times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" 14px;\"=\"\" style=\"font-family: \"Times New Roman\"; font-size: 14px;\">နေပြည်တော် လယ်ဝေးမြို့တွင် ယနေ့ ဒီဇင်ဘာ ၁ ရက်နေ့ နံနက် ၇ နာရီခွဲ အချိန် ဗိုလ်ချုပ်ကြေးရုပ်အနီး မီးပွိုင့်ယာဉ်ထိန်း ရဲကင်းပတ်ဝန်းကျင်တွင် မိုင်း ဖောက်ခွဲခဲ့ကြောင်း ပြည်သူ့ကာကွယ်ရေးအဖွဲ့- နေပြည်တော်(ပ.က.ဖ)မှ တာဝန် ရှိသူတစ်ဦးက ရန်ကုန်ခေတ်သစ်သတင်းဌာနထံသို့ ပြောဆိုသည်။ </span></div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" segoe=\"\" ui=\"\" historic\",=\"\" \"segoe=\"\" ui\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(5,=\"\" 5,=\"\" 5);=\"\" font-size:=\"\" 15px;\"=\"\" style=\"font-family: Padauk, Arial, Verdana, Geneva, Helvetica, sans-serif; white-space: pre-wrap; margin: 0.5em 0px 0px; overflow-wrap: break-word;\"><div dir=\"auto\" style=\"font-family: inherit;\"><span times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" 14px;\"=\"\" style=\"font-family: \"Times New Roman\"; font-size: 14px;\">လယ်ဝေးမြို့နယ်၊ ဗိုလ်ချုပ်ကြေးရုပ်အနီး မီးပွိုင့်ယာဉ်ထိန်းရဲကင်းအနီးတွင် အသံ မိုင်းဖြင့် လုံခြုံရေးအတွက် လာရောက် စစ်ဆေးကြမည့် စစ်သားကို မြှား ခေါ်၍ အဓိကမိုင်းဖြင့် တိုက်ခိုက်ရန်စီစဉ်ခဲ့ကြောင်း၊ သို့ရာတွင် အဓိက မိုင်းကို  လူတချို့က ကောက်ယူသွားသည်ဟု ယူဆရပြီး စစ်တပ်ကို မြှားခေါ်သည့် အသံမိုင်း သာ ပေါက်ကွဲခဲ့ကြောင်း၊ တိုက်ခိုက်မှုကို ပြည်သူ့ကာကွယ်ရေးအဖွဲ့ - နေပြည်တော်(ပ.က.ဖ)နှင့် ပျဉ်းမနား ပ.က.ဖ တို့က ပူးပေါင်းစီစဉ် လုပ် ဆောင် ခဲ့ ခြင်းဖြစ်ကြောင်း သိရှိရသည်</span></div><div dir=\"auto\" style=\"font-family: inherit;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1601271250_Intrepid-Travel-Nepal_Everest-Base-Camp_Group_Trek03.jpg\" style=\"width: 799.987px;\"><span times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" 14px;\"=\"\"><br></span></div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" segoe=\"\" ui=\"\" historic\",=\"\" \"segoe=\"\" ui\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(5,=\"\" 5,=\"\" 5);=\"\" font-size:=\"\" 15px;\"=\"\" style=\"font-family: Padauk, Arial, Verdana, Geneva, Helvetica, sans-serif; white-space: pre-wrap; margin: 0.5em 0px 0px; overflow-wrap: break-word;\"><div dir=\"auto\" style=\"font-family: inherit;\"><span times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" 14px;\"=\"\" style=\"font-family: \"Times New Roman\"; font-size: 14px;\">စစ်ကောင်စီက အကြမ်းဖက် စစ်တပ် ရုံးစိုက်ရာ နေပြည်တော်နှင့် ပတ်ဝန်း ကျင် မြို့နယ်များတွင် ဘန်ကာများ၊ လှည့် ကင်းများ၊ ကင်းပုန်းများ ချထားပြီး လုံခြုံရေးအထူးတင်းကျပ်ထားကြောင်း သိရှိရသည်။</span></div></div>', '2022-12-01', '[{\"value\":\"student\"},{\"value\":\"university\"}]', 1, 1, '2022-11-30 22:40:27', '2022-11-30 22:45:27', '1669871427_1601689952_1600660201_img2.jpg', '1669871427_1668265380_1601876963_mandlay.jpeg');
