(2, '1', 1, 'ဒီပဲယင်းနှင့် ရေဦး အစပ်ရှိ ကျေးရွာ ၂ ရွာကို စစ်တပ်မီးရှို့မှု နေအိမ် ၂၀ ကျော်ပြာကျ', 'Shanghai police detain people at protest site', '<p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur quis nisl eu purus pretium aliquam. Ut hendrerit mollis posuere. Donec hendrerit lorem enim, semper tincidunt arcu viverra et. Aenean maximus ligula nec nibh viverra malesuada. Fusce commodo ornare mattis. Aenean luctus viverra dapibus. Suspendisse diam ipsum, cursus eu erat et, tempor luctus nisl. In hac habitasse platea dictumst.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Proin sit amet neque nulla. Nam tempus sodales velit vitae pharetra. Curabitur semper eget ante eget dictum. Ut ex nunc, posuere eget facilisis eu, lobortis eget orci. Aliquam erat volutpat. Fusce cursus laoreet arcu, in iaculis ligula efficitur suscipit. Pellentesque ac facilisis lectus. In luctus ipsum id lectus mollis ornare. Etiam tristique tincidunt lacus.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Praesent luctus tempus scelerisque. Morbi nec ullamcorper lectus. Etiam pharetra sit amet felis eu dignissim. Nunc eleifend sapien id massa porta, feugiat dignissim ligula pellentesque. Nulla tristique id ligula ut sollicitudin. Vivamus consequat quis est quis venenatis. Cras ex tortor, varius et nisi ut, ultrices aliquet massa. Pellentesque ac bibendum sapien. Curabitur non congue massa. Aenean eu ultricies nunc.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Aenean odio nisi, aliquet et metus sit amet, volutpat euismod eros. Vestibulum vel augue odio. In ac pharetra arcu, ut sodales arcu. Vestibulum convallis nulla a scelerisque tincidunt. Nam gravida justo eget massa luctus hendrerit. Duis at mauris consequat, varius orci a, condimentum lectus. Mauris in varius augue. Etiam suscipit tortor dui, non interdum mauris laoreet at. Sed quis blandit erat. Donec facilisis risus nec aliquet consequat. Etiam eu ante justo. Cras feugiat ut est in sollicitudin.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Duis molestie hendrerit nibh, in posuere felis finibus nec. Quisque tincidunt nisi nec nunc accumsan dictum quis sit amet tellus. Sed cursus erat dui, eget rhoncus tellus aliquet in. Nam lacinia tincidunt sem id tempor. In non ligula sit amet orci efficitur aliquet. Duis accumsan, velit et rhoncus dignissim, ex augue cursus ex, venenatis consectetur mauris leo eu felis. Quisque id semper nisl. Aenean laoreet risus id est congue, in molestie dolor consectetur.</p>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">စစ်ကိုင်းတိုင်း၊ ဒီပဲယင်းမြို့နယ်နှင့် ရေဦးမြို့နယ် အစပ်ရှိ ​ကျေးရွာ ၂ ရွာကို အကြမ်းဖက် စစ်တပ် မီးရှို့မှု နေအိမ် ၂၀ ကျော် ပြာကျခဲ့ကြောင်း သိရသည်။</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ဒီဇင်ဘာလ ၁ ရက်နေ့ နံနက်ပိုင်းတွင် အကြမ်းဖက် စစ်တပ်က ဒီပဲယင်းမြို့နယ်ရှိ ပျော်ဘွယ်ရွာနှင့် ရေဦးမြို့နယ်ရှိ မစိုးရိမ်ရွာတို့ကို ဝင်ရောက် မွှေနှောက်ပြီးနောက် ပြည်သူပိုင်နေအိမ် ၂၀ ကျော်ကို မီးရှို့ဖျက်ဆီးခဲ့ခြင်းဖြစ်ကြောင်း သိရသည်။ </div><div dir=\"auto\" style=\"font-family: inherit;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1601181364_myitkyina.jpg\" style=\"width: 629.992px;\"><br></div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\" ဒီပဲယင်းနဲ့ ရေဦးမြို့နယ်က ပျော်ဘွယ်ရွာနဲ့ မစိုးရိမ်ရွာ ၂ ရွာကို မနေ့ ညက စစ်ခွေးတွေ ရွာထဲတပ်စွဲပြီး နံနက်ရောက်တော့ မီးရှို့သွားတယ်။ လက်တလော သိရသလောက်ကတော့ အိမ်ခြေ ၂၀ကျော် အရှို့ခံလိုက်ရတယ်။ ရွာသူ ရွာသားတွေလည်း ပြေးနေရတော့ အကုန်ပြန် မရောက်ကြသေးလို့ အသေးစိတ်တော့ မသိရသေးဘူး\" ဟု ဒေသခံ ပြည်သူ တစ်ဦးကပြောဆိုသည်။</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">အကြမ်းဖက် စစ်တပ် မီးရှို့ဖျက်ဆီးသွားသည့် ပျော်ဘွယ်ရွာသည် ဒုတိယအကြိမ်မြောက် မီးရှို့ခံရခြင်း ဖြစ်ပြီး ဇွန်လ ပိုင်းကလည်း မီးရှို့ဖျက်ဆီးခံရပြီး နေအိမ် ၉ လုံးပြာကျခဲ့ကြောင်း သိရှိရသည်။</div></div>', '2022-12-01', '[{\"value\":\"depaeyin\"},{\"value\":\"village\"}]', 1, 1, '2022-12-01 01:54:28', '2022-12-01 01:54:28', '1669883068_img3.jpg', '1669883068_d1.PNG');
