\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Aenean odio nisi, aliquet et metus sit amet, volutpat euismod eros. Vestibulum vel augue odio. In ac pharetra arcu, ut sodales arcu. Vestibulum convallis nulla a scelerisque tincidunt. Nam gravida justo eget massa luctus hendrerit. Duis at mauris consequat, varius orci a, condimentum lectus. Mauris in varius augue. Etiam suscipit tortor dui, non interdum mauris laoreet at. Sed quis blandit erat. Donec facilisis risus nec aliquet consequat. Etiam eu ante justo. Cras feugiat ut est in sollicitudin.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Duis molestie hendrerit nibh, in posuere felis finibus nec. Quisque tincidunt nisi nec nunc accumsan dictum quis sit amet tellus. Sed cursus erat dui, eget rhoncus tellus aliquet in. Nam lacinia tincidunt sem id tempor. In non ligula sit amet orci efficitur aliquet. Duis accumsan, velit et rhoncus dignissim, ex augue cursus ex, venenatis consectetur mauris leo eu felis. Quisque id semper nisl. Aenean laoreet risus id est congue, in molestie dolor consectetur.</p>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">စစ်ကိုင်းတိုင်း၊ ထီးချိုင့်မြို့နယ်၊ လေသာကျေးရွာကို ယမန်နေ့ ညပိုင်းတွင် စစ်တပ်က  လေယာဉ် ဖြင့် ဗုံးကျဲပြီး ယနေ့ နံနက်ပိုင်း မီးတင်ရှို့နေကြောင်း ဒေသ ပြည်သူများက ရန်ကုန်ခေတ်သစ်သတင်းဌာနထံသို့ ပြောဆိုသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\"မနေ့ည ၉ နာရီ ၄၀ မိနစ်အချိန် စစ်တပ်က  YAK တိုက်လေယာဉ်နဲ့  ထီးချိုင့်မြို့နယ် လေသာ ရွာကို   ဗုံးကျဲတိုက်ခိုက်ခဲ့ပါတယ်။ ဒီမနက်မှာတော့ လေသာ ကျေးရွာ ကို စစ်ခွေးတွေက မီးတင်ရှို့တာ အခု မွန်းလွဲ ၁ နာရီအထိ မီးလောင်နေတုန်းပါပဲ။ ပြည်သူတွေ ကတော့ ထွက်ပြေးနေရတာ ၁ ပတ်ကျော်နေပြီ\" ဟု ဒေသပြည်သူတစ်ဦးက ပြောသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ထီးချိုင့်မြို့နယ်အတွင်း ဇန်နဝါရီလမှ နိုဝင်ဘာလအထိ အကြမ်းဖက် စစ် ကောင် စီ ၏ လေကြောင်းဖြင့် ဗုံးကြဲခံရမှု ၅ ကြိမ်နှင့် ကျေးရွာ ၇ ရွာ မီးရှို့ခံ ခဲ့ရကြောင်း Tigyaing Revolution – TR က ပြောသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\"> ဇန်နဝါရီလ ၁၃ ရက်နေ့တွင် ဂျက်ဖိုက်တာ ၂ စီးဖြင့် ထီးချိုင့်မြို့နယ်၊ မရသိမ် ရွာ ကို ဗုံးကျဲချတိုက်ခိုက်ခဲ့ပြီး ဩဂုတ် ၂၉ ရက်နေ့တွင် ဂျက်ဖိုက်တာ ၂ စီးဖြင့် ပျဉ်းစုရွာ အနီးကို ဗုံးကျဲခဲ့ကြောင်း၊ နိုဝင်ဘာ ၂၇ ရက်နေ့တွင် YAK 130 ဂျက် ဖိုက် တာ တစ်စီးဖြင့် အလယ်တောရွာအနီးတွင် ဗုံးကျဲခဲ့ကြောင်း၊ နိုဝင်ဘာ ၂၈ ရက်နေ့တွင်မူ ဂျက်ဖိုက်တာ နှစ်စီးဖြင့် အင်ကြင်းကုန်းနှင့် လေသာရွာများကို ဗုံးကျဲတိုက်ခိုက်ခဲ့ကြောင်း၊ နိုဝင်ဘာ ၃၀ ရက်နေ့တွင်မူ ဂျက်ဖိုက်တာ တစ်စီး ဖြင့်  လေသာရွာအနီး ဗုံးကျဲချ တိုက်ခိုက်ခဲ့ကြောင်း သိရှိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ထို့ပြင် ထီးချိုင့်မြို့နယ်အတွင်း မတ်လ ၆ ရက်နေ့တွင် သခွတ်ချောင်ရွာရှိ နေ အိမ် ၁၂ လုံး၊ နိုဝင်ဘာ ၁၁ ရက်နေ့တွင် ကျက်သရေချောင်းရွာရှိ နေအိမ် ၁၅ လုံး၊ နိုဝင်ဘာ ၂၅ ရက်နေ့တွင် ဆူးပုတ်ချောင်ရွာရှိ နေအိမ် ၄၀ လုံး၊ နိုဝင်ဘာ ၂၈ ရက်နေ့တွင် အင်ကြင်းကုန်းနှင့် အလယ်တောရွာရှိ နေအိမ်များ မီးရှို့ခံရမှု (အရေအတွက် မသိရသေး)၊ နိုဝင်ဘာ ၂၉ ရက်နေ့တွင် အင်းတိန်ရွာ မီးရှို့ခံရမှု (အရေအတွက် မသိရသေး)၊ နိုဝင်ဘာ ၃၀ ရက်နေ့တွင် လေသာရွာ မီးရှို့ခံရမှု (အရေအတွက် မသိရသေး) ကြောင်း ၊ စစ်တပ်က ဧရာ၀တီ မြစ် အရှေ့ဘက် ကမ်းဘက်တွင်လည်း မီးရှို့ခံရမှုများရှိပြီး စစ်တပ်က မီးရှို့ ဖျက်ဆီးမှုများ လုပ် ဆောင်ခဲ့‌ကြောင်း သိရှိရသည်။</div></div>', '2022-11-30', '[{\"value\":\"fire\"},{\"value\":\"htechaint\"}]', 1, 1, '2022-12-01 01:55:45', '2022-12-01 01:55:45', '1669883145_1669308961_1668996381_news-500x280-1.jpg', '1669883145_1668265507_img4.jpg'),
