ttom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px;\">Aenean odio nisi, aliquet et metus sit amet, volutpat euismod eros. Vestibulum vel augue odio. In ac pharetra arcu, ut sodales arcu. Vestibulum convallis nulla a scelerisque tincidunt. Nam gravida justo eget massa luctus hendrerit. Duis at mauris consequat, varius orci a, condimentum lectus. Mauris in varius augue. Etiam suscipit tortor dui, non interdum mauris laoreet at. Sed quis blandit erat. Donec facilisis risus nec aliquet consequat. Etiam eu ante justo. Cras feugiat ut est in sollicitudin.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px;\">Duis molestie hendrerit nibh, in posuere felis finibus nec. Quisque tincidunt nisi nec nunc accumsan dictum quis sit amet tellus. Sed cursus erat dui, eget rhoncus tellus aliquet in. Nam lacinia tincidunt sem id tempor. In non ligula sit amet orci efficitur aliquet. Duis accumsan, velit et rhoncus dignissim, ex augue cursus ex, venenatis consectetur mauris leo eu felis. Quisque id semper nisl. Aenean laoreet risus id est congue, in molestie dolor consectetur.</p>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \"Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">နေပြည်တော် လယ်ဝေးမြို့တွင် ယနေ့ ဒီဇင်ဘာ ၁ ရက်နေ့ နံနက် ၇ နာရီခွဲ အချိန် ဗိုလ်ချုပ်ကြေးရုပ်အနီး မီးပွိုင့်ယာဉ်ထိန်း ရဲကင်းပတ်ဝန်းကျင်တွင် မိုင်း ဖောက်ခွဲခဲ့ကြောင်း ပြည်သူ့ကာကွယ်ရေးအဖွဲ့- နေပြည်တော်(ပ.က.ဖ)မှ တာဝန် ရှိသူတစ်ဦးက ရန်ကုန်ခေတ်သစ်သတင်းဌာနထံသို့ ပြောဆိုသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \"Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">လယ်ဝေးမြို့နယ်၊ ဗိုလ်ချုပ်ကြေးရုပ်အနီး မီးပွိုင့်ယာဉ်ထိန်းရဲကင်းအနီးတွင် အသံ မိုင်းဖြင့် လုံခြုံရေးအတွက် လာရောက် စစ်ဆေးကြမည့် စစ်သားကို မြှား ခေါ်၍ အဓိကမိုင်းဖြင့် တိုက်ခိုက်ရန်စီစဉ်ခဲ့ကြောင်း၊ သို့ရာတွင် အဓိက မိုင်းကို  လူတချို့က ကောက်ယူသွားသည်ဟု ယူဆရပြီး စစ်တပ်ကို မြှားခေါ်သည့် အသံမိုင်း သာ ပေါက်ကွဲခဲ့ကြောင်း၊ တိုက်ခိုက်မှုကို ပြည်သူ့ကာကွယ်ရေးအဖွဲ့ - နေပြည်တော်(ပ.က.ဖ)နှင့် ပျဉ်းမနား ပ.က.ဖ တို့က ပူးပေါင်းစီစဉ် လုပ် ဆောင် ခဲ့ ခြင်းဖြစ်ကြောင်း သိရှိရသည်။</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \"Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\"အဓိက ဖောက်ခွဲမယ့် မိုင်းအကြီးကို အမှိုက်ကောက် တဲ့သူတွေ ကောက် သွား တယ်ထင်ရတာပဲ ။ ပစ္စည်းက လူသုံးကုန် ပစ္စည်းအခွံ့ နဲ့လုံးထား တာ ဆိုတော့ ရောင်းရတယ်ထင်ပြီးကောက်သွားပုံရပါတယ်။ နွေဉီးတော်လှန် ရေးအောင် မြင်ဖို့အကောင်းဆုံးကြိုးစားနေပါတယ် ။အရှိန်အဟုန်မြှင့် ဆက်လက် ဆောင် ရွက် သွားပါမယ်\" ဟု ပြည်သူ့ကာကွယ်ရေး အဖွဲ့ - နေပြည်တော်မှ တာဝန်ရှိသူ တစ်ဦးက ဆိုသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \"Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">စစ်ကောင်စီက အကြမ်းဖက် စစ်တပ် ရုံးစိုက်ရာ နေပြည်တော်နှင့် ပတ်ဝန်း ကျင် မြို့နယ်များတွင် ဘန်ကာများ၊ လှည့် ကင်းများ၊ ကင်းပုန်းများ ချထားပြီး လုံခြုံရေးအထူးတင်းကျပ်ထားကြောင်း သိရှိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: \"Segoe UI Historic\", \"Segoe UI\", Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ဓာတ်ပုံ- နေပြည်တော်၊ လယ်ဝေးမြို့၊ ဗိုလ်ချုပ်ကြေးရုပ်အနီး မြင်ကွင်း။ (ပုံအဟောင်းဖြစ်သည်)</div></div>', '2022-11-30', '[{\"value\":\"business\"}]', 1, 1, '2022-12-01 01:57:21', '2022-12-01 02:10:18', '1669883241_business.PNG', '1669883241_1668265380_1601876963_mandlay.jpeg'),
