stify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Aenean odio nisi, aliquet et metus sit amet, volutpat euismod eros. Vestibulum vel augue odio. In ac pharetra arcu, ut sodales arcu. Vestibulum convallis nulla a scelerisque tincidunt. Nam gravida justo eget massa luctus hendrerit. Duis at mauris consequat, varius orci a, condimentum lectus. Mauris in varius augue. Etiam suscipit tortor dui, non interdum mauris laoreet at. Sed quis blandit erat. Donec facilisis risus nec aliquet consequat. Etiam eu ante justo. Cras feugiat ut est in sollicitudin.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Duis molestie hendrerit nibh, in posuere felis finibus nec. Quisque tincidunt nisi nec nunc accumsan dictum quis sit amet tellus. Sed cursus erat dui, eget rhoncus tellus aliquet in. Nam lacinia tincidunt sem id tempor. In non ligula sit amet orci efficitur aliquet. Duis accumsan, velit et rhoncus dignissim, ex augue cursus ex, venenatis consectetur mauris leo eu felis. Quisque id semper nisl. Aenean laoreet risus id est congue, in molestie dolor consectetur.</p>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ရန်ကုန်တိုင်း၊ မရမ်ကုန်းမြို့နယ် ၁ ရပ်ကွက်အတွင်းရှိ အိမ်ခြေ ၁၂၀ ကျော်ကို ကျူးကျော်ဟုဆိုကာ စစ် တပ် အင်အား အလုံးအရင်းဖြင့် ဝင်ရောက်စီးနင်းပြီး ဘူဒိုဇာဖြင့် ဖျက်ဆီးကြောင်း ဒေသခံ ပြည်သူ များ က ရန်ကုန်ခေတ်သစ် သ တင်း ဌာန ထံသို့ ပြောဆိုကြသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">နိုဝင်ဘာလ ၃၀ ရက်နေ့ နံနက် ၆  နာရီခွဲအချိန် စစ်တပ်၊ ရဲ၊ စည်ပင်နှင့် ပျူစော ထီး စုစုပေါင်း အင် အား ၁၀၀ ဝန်းကျင်ဖြင့် လမ်းများပိတ်၍ ဝင်ရောက်လာပြီး မရမ်းကုန်းမြို့နယ် ၁ ရပ်ကွက် ဘောလုံး ကွင်းဘေးရှိ နေအိမ်များကို ဘူဒိုဇာ များ ဖြင့် အတင်းအကျပ် ဖျက်ဆီးကြောင်း သိရှိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">\"သမိုင်း ၁ ရပ်ကွက် မြို့သစ် ၇လမ်း ၈လမ်း ၉လမ်းဘောလုံးကွင်းဘေးက အိမ် တွေကိုစစ်တပ်က အင် အားအလုံး အရင်း နဲ့ ဘူဒို ဇာနဲ့ထိုး နေပါတယ်။ ဒီနေ့ မနက် ၆နာရီ ခွဲကတည်းက ဖျက်နေတာပါ။ မရမ်းကုန်း မြို့နယ် သမိုင်း ၁ ရပ် ကွက်၊ မြို့သစ် ၇လမ်း ၈လမ်း ၉လမ်း နဲ့ ဘောလုံးကွင်အိမ်ခြေ ၁၂၀ ကျော် လောက် ကို ဖျက်ဆီးပါတယ်။ လမ်းတွေပိတ်တယ်။ စစ်ကား ၂ စီးနဲ့   အင်အား စုစုပေါင်း ၅၀ ကျော်မယ်။ ရဲရော ပျူစောထီးရော စုစုပေါင်း ၁၀၀ ကျော်တယ်။  မနော်ဟယ်ရီ လမ်း ကနေလမ်း ပိတ်ပြီး ဖျက်တယ်။ အခု အဖျက်ခံ ရတာက ၁၂၀ ကျော်တယ်။ အိမ်တွေဖျက်နေတာကို ဓာတ်ပုံ ရိုက်တဲ့  အမျိုးသမီး တစ် ယောက်ကို  ခွေးတွေ ဘယ်လိုတွေ့သွားလဲ မသိဘူး။  တိုက်ပေါ် ထိတက် ဖမ်း  တယ်။  လူရောဖုန်းရော အကုန်ပါသွားတယ်။ အခုထက်ထိ ဖျက်နေတုန်း\" ဟု ဒေသခံပြည်သူတစ်ဦးက ရန်ကုန်ခေတ်သစ် သတင်းဌာနထံသို့ ပြောဆိုသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">အကြမ်းဖက်စစ်ကောင်စီက ရန်ကုန်မြို့ အပါအဝင်မြို့ကြီးများမှ ပြည်သူပိုင် နေ အိမ် များကို ကျူး ကျော် ဟုဆိုကာ အင် အား သုံးဖျက်ဆီးခြင်း၊ ဘူဒိုဇာဖြင့် ထိုး ခြင်း အပါအဝင် ဥပဒေမဲ့ အကြမ်း ဖက်လုပ် ရပ်များ ကို ဆက်တိုက်ဆိုသလို လုပ် ဆောင်လျက်ရှိကြောင်း သိရှိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">ဓာတ်ပုံ- အကြမ်းဖက် စစ်တပ်က သမိုင်း ၁ ရပ်ကွက်ကို ဝင်ရောက်ဖျက် ဆီး နေစဉ်။</div></div>', '2022-12-12', '[{\"value\":\"plane\"}]', 1, 1, '2022-12-01 02:00:06', '2022-12-01 02:00:06', '1669883406_Tazaungdaing-6.jpg', '1669883406_12.PNG'),
