 text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Aenean odio nisi, aliquet et metus sit amet, volutpat euismod eros. Vestibulum vel augue odio. In ac pharetra arcu, ut sodales arcu. Vestibulum convallis nulla a scelerisque tincidunt. Nam gravida justo eget massa luctus hendrerit. Duis at mauris consequat, varius orci a, condimentum lectus. Mauris in varius augue. Etiam suscipit tortor dui, non interdum mauris laoreet at. Sed quis blandit erat. Donec facilisis risus nec aliquet consequat. Etiam eu ante justo. Cras feugiat ut est in sollicitudin.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">Duis molestie hendrerit nibh, in posuere felis finibus nec. Quisque tincidunt nisi nec nunc accumsan dictum quis sit amet tellus. Sed cursus erat dui, eget rhoncus tellus aliquet in. Nam lacinia tincidunt sem id tempor. In non ligula sit amet orci efficitur aliquet. Duis accumsan, velit et rhoncus dignissim, ex augue cursus ex, venenatis consectetur mauris leo eu felis. Quisque id semper nisl. Aenean laoreet risus id est congue, in molestie dolor consectetur.</p>', '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">တနင်္သာရီတိုင်း၊ သရက်ချောင်းမြို့နယ်တွင် ဗိုလ်မှူး ဝင်းဌေးနိုင် အလောင်းလာကောက်ပြီး ပြန်လာသည့် စစ်ကား ၂ စီးကို PDF တပ်ဖွဲ့က မိုင်းဆွဲ တိုက်ခိုက်ခဲ့ပြီး စစ်သား ၄ ဦးသေဆုံးကြောင်း သိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">နိုဝင်ဘာလ ၂၉ ရက်နေ့ မွန်းလွဲ ၁ နာရီ ၂၀ မိနစ်တွင် သရက်ချောင်းမြို့နယ် ဝဲရစ်ရွာထိပ်၌ ဘုတ်ပြင်မှ ဗိုလ်မှူး ဝင်းဌေးနိုင် အလောင်းလာကောက်ပြီး ပြန်လာသည့် စစ်ကား ၂ စီးကို ကာကွယ်ရေး တပ်ဖွဲ့များက မိုင်းဆွဲ တိုက်ခိုက်ခဲ့ပြီး အပြန်အလှန် ပစ်ခတ်မှု ၁၀ မိနစ်ခန့်ဖြစ်ပွားခဲ့ကာ စစ်သား ၄ ဦး သေဆုံးခဲ့ကြောင်း သိရှိရသည်။</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">အဆိုပါ တိုက်ခိုက်မှုကို သရက်ချောင်းမြို့နယ် ပြည်သူ့ကာကွယ်ရေးအဖွဲ့ (ပကဖ) အဖွဲ့ဝင် မဟာမိတ် ၃ ဖွဲ့ဖြစ်သည့် T.Y.C ပုတီးတစ်လုံးပြောက်ကျားတပ်ဖွဲ့၊ ကျားရိုင်းပြောက်ကျားတပ်ဖွဲ့၊ ဂဠုန်မင်းပြောက်ကျားတပ်ဖွဲ့နှင့် ပူးပေါင်း​အဖွဲ့ အဖြူရောင်ရိန်းဂျားပြောက်ကျားတပ်ဖွဲ့တို့ ပူးပေါင်းကာ လုပ်ဆောင်ခဲ့ခြင်းဖြစ်ကြောင်း ထုတ်ပြန်ထားသည်။</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">အလားတူ စစ်ကိုင်းတိုင်း မော်လိုက်မြို့တွင်လည်း အကြမ်းဖက် စစ်တပ် စစ်ကြောင်းများ မိုင်းဆွဲ တိုက်ခိုက်ခံရပြီး စစ်သား ၅ ဦးသေဆုံးကြောင်း သိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">နိုဝင်ဘာလ ၂၉ ရက်နေ့တွင် မော်ကူးရွာဘက်သို့ အင်အား ၃၀ ခန့်ဖြင့ တက်လာသည့် အကြမ်းဖက် စစ်တပ် စစ်ကြောင်းကို ဒေသခံ ကာကွယ်ရေး တပ်ဖွဲ့များက ရှေ့ထွက်မိုင်း ၂ လုံးဖြင့် ဖောက်ခွဲ တိုက်ခိုက်ခဲ့ပြီး စစ်သား ၂ ဦး သေဆုံးခဲ့ကြောင်း သိရသည်။ </div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; white-space: pre-wrap; overflow-wrap: break-word; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">နိုဝင်ဘာလ ၂၃ ရက်နေ့ကလည်း မော်ကူးရွာဘက်သို့ အင်အား ၅၀ ခန့်ဖြင့် တက်လာသည့် အကြမ်းဖက် စစ်တပ် စစ်ကြောင်း ရှေ့ထွက်မိုင်း ၃ လုံးဖြင့် ဖောက်ခွဲ တိုက်ခိုက်ခံရပြီး စစ်သား ၃ ဦးသေဆုံးခဲ့ကြောင်း သိရသည်။</div></div>', '2022-12-24', NULL, 1, 1, '2022-12-01 02:04:22', '2022-12-01 02:04:22', '1669883662_1668213841_1600662112_img1.jpg', '1669883662_1600663917_img7.jpg');

